import ExpenseItem from "./ExpenseItem";
import './ExpensesList.css';

const ExpensesList = ({ expenses }) => {
  return (
    <div className='expenses'>
      <ul>
        {expenses.map(expense => {
          <li key={expense.key}>
            <ExpenseItem title={expenses.title} />
          </li>
      })}
      </ul>
    </div>
  )
}

export default ExpensesList;
